import React from "react";
import { NavLink } from "react-router-dom";

const MenuBar = ({ text, path }) => {
  const listItems = text.forEach((i) => (
    <li>
      <NavLink className="navbar-item" exact to={path[i]}>
        {text[i]}
      </NavLink>
    </li>
  ));

  return (
    <ul className="navbar-menu">
      <li>
        <NavLink className="navbar-item" exact to={path[0]}>
          {text[0]}
        </NavLink>
      </li>
      <li>
        <NavLink className="navbar-item" exact to={path[1]}>
          {text[1]}
        </NavLink>
      </li>
      <li>
        <NavLink className="navbar-item" exact to={path[2]}>
          {text[2]}
        </NavLink>
      </li>
    </ul>
  );
};

export default MenuBar;
